import UsageSvg from "../public/media/usage.svg";


// web usage 6 for normall users
// mobile usage 10 usage for normall users 

const Usage = () => {
    return (

        <section className="mt-5">
            <div className="container shadow-lg py-5 px-5 rounded-section my-4">
                <h2 className="display-4 text-center mb-lg-4  mb-4">الاستخدام</h2>
                <div className={"row "}>
                    <div className={"col-lg-8  col-12 mx-lg-0 mx-auto"}>
                        <div className="container-fluid">
                            <div className="row justify-content-center">
                                <div className="col-4 mx-2 rounded-section shadow-lg" style={{backgroundColor:"#EB095E",color:'#ffff'}}>
                                    web usage
                                </div>
                                <div className="col-4 mx-2 rounded-section shadow-lg" style={{backgroundColor:"#D18C08",color:'#ffff'}}>
                                    mobile usage
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className={"col-lg-4 col-8  mx-auto order-lg-last order-first"}>
                        <img src={UsageSvg} className="w-100"/>
                    </div>
                </div>
            </div>
        </section>
    )
};

export default Usage;
